information is used as part of the C<ListPartnerApps> API response.

=head1 ATTRIBUTES


=head2 Arn => Str

The ARN of the SageMaker Partner AI App.


=head2 CreationTime => Str

The creation time of the SageMaker Partner AI App.


=head2 Name => Str

The name of the SageMaker Partner AI App.


=head2 Status => Str

The status of the SageMaker Partner AI App.


=head2 Type => Str

The type of SageMaker Partner AI App to create. Must be one of the
following: C<lakera-guard>, C<comet>, C<deepchecks-llm-evaluation>, or
C<fiddler>.



